        knot = Knot(1, 1)
        self.assertEqual(
            knot.strings,
            [
                String(
                    0,
                    [
                        Segment(End(Fraction(0, 1), 0), End(Fraction(2, 1), 0)),
                    ],
                    [
                    ],
                ),
            ]
        )

